import React from 'react'

const Popup = ({ toggle, errorMsg, info }) => {
  console.log('info', info)
  return (
    <div className="popup">
      {errorMsg ? (
        <>
          <header>Error</header>
          <p>Error: {errorMsg}</p>
        </>
      ) : (
        <>
          <header>Info</header>
          <p>Mail: {info}</p>
        </>
      )}
      <button onClick={toggle}>Close</button>
    </div>
  )
}

export default Popup
